/*!50003 CREATE*/ /*!50017 DEFINER=`Group6Login`@`%`*/ /*!50003 TRIGGER `check_commodity_stock_before_purchase` BEFORE INSERT ON `commodity_sale` FOR EACH ROW BEGIN
    DECLARE current_stock INT;
    DECLARE item_name VARCHAR(255);
    DECLARE error_message VARCHAR(500);
    
    -- Get current stock and item name from commodity_type table
    SELECT Stock_Quantity, Commodity_Name 
    INTO current_stock, item_name
    FROM commodity_type 
    WHERE Commodity_TypeID = NEW.Commodity_TypeID;
    
    -- Check if quantity is valid (must be greater than 0)
    IF NEW.Quantity <= 0 THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Quantity must be greater than 0';
    END IF;
    
    -- Check if item is completely out of stock
    IF current_stock <= 0 THEN
        SET error_message = CONCAT('Item "', item_name, '" is out of stock');
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = error_message;
    END IF;
    
    -- Check if there's sufficient stock for the requested quantity
    IF current_stock < NEW.Quantity THEN
        SET error_message = CONCAT('Insufficient stock. Only ', current_stock, ' item(s) available for "', item_name, '"');
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = error_message;
    END IF;
END */;;
DELIMITER ;
