/*!50003 CREATE*/ /*!50017 DEFINER=`Group6Login`@`%`*/ /*!50003 TRIGGER `deduct_commodity_stock_after_purchase` AFTER INSERT ON `commodity_sale` FOR EACH ROW BEGIN
    -- Automatically deduct the purchased quantity from stock
    UPDATE commodity_type
    SET Stock_Quantity = Stock_Quantity - NEW.Quantity
    WHERE Commodity_TypeID = NEW.Commodity_TypeID;
END */;;
