/*!50003 CREATE*/ /*!50017 DEFINER=`Group6Login`@`%`*/ /*!50003 TRIGGER `update_alert_on_maintenance_complete` BEFORE UPDATE ON `maintenance_request` FOR EACH ROW BEGIN
    -- Check if status is being changed to "Completed"
    -- OLD.Status refers to the status before the update
    -- NEW.Status refers to the status after the update
    IF NEW.Status = 'Completed' AND (OLD.Status IS NULL OR OLD.Status != 'Completed') THEN
        -- Set Alert_ID to 4 (None) when maintenance is completed
        SET NEW.Alert_ID = 4;
    END IF;
end */;;
